import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import classes from "../styles/Contact.module.css";


export default function Contact() {

  const myStyle = {
    backgroundImage: "url(" +
    "https://images.pexels.com/photos/1687341/pexels-photo-1687341.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1.jpg" + ")",
    backgroundSize: 'cover',
    alt: 'Photo by Igor Haritanovich from Pexels',
  }

  return (
    <div>
      <Navbar />
      <div className={classes.contactContainer} style={myStyle}>
        <h1 className={`${classes.pageTitle} ${classes.shadowsIntoLightRegular}`}><strong>Contact Me</strong></h1>
        <p>If you have any questions or are ready to take the next step, feel free to reach out!</p>
      </div>
      <Footer />
    </div>
  )
}
